    n = int(stdin.split()[0])
    graph = {}
    for line in stdin.split()[1:]:
        a, b = [int(x) for x in line.split(' ')]
        graph[a] = graph.get(a, [])
        graph[b] = graph.get(b, [])
        graph[a].append(b)
        graph[b].append(a)
    def path_count(graph, start, end):
        s = [(start, [start])]
        seen = set()
        while s:
            (vertex, path) = s.pop()
            seen.add(vertex)
            if vertex == end:
                return path
            for neighbor in graph.get(vertex, []):
                if neighbor not in seen:
                    s.append((neighbor, path + [neighbor]))
        return []
    def path_union(paths):
        res = []
        for path in paths:
            if not res:
                res = set(path)
            else:
                res = res.intersection(path)
        return list(res)
    def path_intersection(paths):
        res = []
        for path in paths:
            if not res:
                res = set(path)
            else:
                res = res.intersection(path)
        return list(res)
    path_a = path_count(graph, 1, n)
    path_b = path_count(graph, 1, n)
    path_c = path_count(graph, 1, n)
    union_ab = path_union([path_a, path_b])
    union_ab.sort()
    union_ac = path_union([path_a, path_c])
    union_ac.sort()
    intersection_ab = path_intersection([path_a, path_b])
    intersection_ac = path_intersection([path_a, path_c])
    intersection_ab.sort()
    intersection_ac.sort()
    sorted_set = union_ab + union_ac + intersection_ab + intersection_ac
    sorted_set.sort()
