    """Returns the number of ways to choose three of the sticks with different lengths that can form a triangle.

    >>> solution("5\n4 4 9 7 5\n")
    '5'
    """

    def is_valid(lengths: tuple[int,...]) -> bool:
        """Returns whether or not the given lengths of sticks can form a triangle.

        >>> is_valid((4, 4, 9, 7, 5))
        True
        >>> is_valid((4, 4, 9, 7))
        False
        """
        # noinspection PyTypeChecker
        return lengths[0] + lengths[1] > lengths[2] and lengths[0] + lengths[2] > lengths[1] and lengths[2] + lengths[1] > lengths[0]

    def count_triples(lengths: tuple[int,...]) -> int:
        """Returns the number of triples (i, j, k) satisfying the conditions from is_valid.

        >>> count_triples((4, 4, 9, 7, 5))
        5
        """
        return sum(
            1
            for i in range(len(lengths) - 2)
            for j in range(i + 1, len(lengths) - 1)
            for k in range(j + 1, len(lengths))
            if is_valid((lengths[i], lengths[j], lengths[k]))
        )

    return str(count_triples(tuple(map(int, stdin.split()[1:]))))

