            elif not is_black(grid, i, c):
                set_black(grid, i, c)

    def flip_row(grid, r):
        for c in range(W):
            if is_black(grid, r, c):
                set_white(grid, r, c)
            elif not is_black(grid, r, c):
                set_black(grid, r, c)

