        if len(curr_black_squares) == K:
            choices.add(tuple(choices))
            return
        for i, j in curr_black_squares:
            for new_i in range(i - 1, i + 2):
                for new_j in range(j - 1, j + 2):
                    if 0 <= new_i < H and 0 <= new_j < W and (new_i, new_j) not in curr_black_squares:
                        recurse(choices, curr_black_squares + [(new_i, new_j)])
    recurse(choices, [])
    return str(len(choices))

