    if len(p) == 1:
        return p[0]
    # 4. Binary search
    left, right = 0, len(p) - 1
    while left <= right:
        mid = (left + right) // 2
        if p[mid] == X:
            return p[mid]
        elif p[mid] < X:
            left = mid + 1
        else:
            right = mid - 1
    # 5. If X is less than p[left], then the answer is X - 1
    if X < p[left]:
        return X - 1
    # 6. Otherwise, the answer is X
    return X

