            if charge < 0:
                return False
        return charge >= 0

    def get_max_turn(k, n, a, b):
        if a > b:
            return -1

        # current charge of battery
        charge = k

        # current number of turns to complete game
        turns = 0
        # previous number of turns to complete game
        prev_turns = 0

        while True:
            turns += 1
            charge -= a if charge > a else 0
            charge += b if charge < b else 0
            # the game cannot be completed
            if charge < 0:
                return -1
            # we are the first player in the game
            if turns == 1:
                if can_complete(k, n, a, b):
                    return turns
                else:
                    return -1
            # we are the second player in the game
            else:
                if can_complete(k, n, a, b):
                    prev_turns = turns
                else:
                    return prev_turns

    n, k, a, b = (int(i) for i in stdin.split('\n')[1:][0].split())
