def solution(stdin: str) -> str:
    rows = int(stdin[0])
    columns = int(stdin[1])
    matrix = [[x for x in line.rstrip('\n')] for line in stdin[2:]]

    def move_south(coord: tuple, matrix: list):
        return (coord[0] + 1, coord[1])

    def move_east(coord: tuple, matrix: list):
        return (coord[0], coord[1] + 1)

    def move_west(coord: tuple, matrix: list):
        return (coord[0], coord[1] - 1)

    def move_north(coord: tuple, matrix: list):
        return (coord[0] - 1, coord[1])

    def backtrack(matrix: list, visited: set, row: int, col: int, stars: int, moves: dict):
        if row < 0 or col < 0 or row >= len(matrix) or col >= len(matrix[0]):
            return False
        if matrix[row][col] == '.' or matrix[row][col] == '*':
            return False
        if matrix[row][col] == '*' and (row, col) not in visited:
            visited.add((row, col))
            if move_south((row, col), matrix):
                s = backtrack(matrix, visited, row, col - 1, stars + 1, moves)
                if s:
                    moves[row][col] = (row, col, 'S')
                    return True
            if move_east((row, col), matrix):
                s = backtrack(matrix, visited, row - 1, col, stars + 1, moves)
                if s:
                    moves[row][col] = (row, col, 'E')
                    return True
            if move_west((row, col), matrix):
                s = backtrack(matrix, visited, row - 1, col, stars + 1, moves)
                if s:
                    moves[row][col] = (row, col, 'W')
                    return True
            if move_north((row, col), matrix):
                s = backtrack(matrix, visited, row, col + 1, stars + 1, moves)
                if s:
                    moves[row][col] = (row, col, 'N')
                    return True
            if not s:
                visited.remove((row, col))
        return False

    if not backtrack(matrix, set(), 0, 0, 0, {(0, 0): (0, 0, '.')}):
        return '-1'
    return '\n'.join([' '.join(['{} {} {}'.format(row, col, moves[row][col][2]) for col in range(columns)]) for row in range(rows)])

