def solution(stdin: str) -> str:
    n, m = map(int, stdin.split())
    grid = []
    for _ in range(n):
        row = stdin.split()[0]
        grid.append(row)

    def is_valid(row, col, s):
        if row < 0 or row >= n:
            return False
        if col < 0 or col >= m:
            return False
        for i in range(row - s // 2, row + s // 2 + 1):
            for j in range(col - s // 2, col + s // 2 + 1):
                if i == row and j == col:
                    continue
                if grid[i][j] == '*':
                    return False
        return True

    def find_size(row, col):
        s = 0
        for i in range(row - 1, row + 2):
            for j in range(col - 1, col + 2):
                if is_valid(i, j, s):
                    s += 1
        return s - 1

    def find_combinations(row, col):
        s = 0
        best = 0
        for i in range(row - 1, row + 2):
            for j in range(col - 1, col + 2):
                if is_valid(i, j, s):
                    best = max(best, find_size(i, j))
                    s += 1
        return best

    def find_best_combination(row, col):
        best = find_combinations(row, col)
        for i in range(row - 1, row + 2):
            for j in range(col - 1, col + 2):
                if is_valid(i, j, best):
                    best = max(best, find_size(i, j))
        return best

    best_combination = 0
    best_row, best_col = 0, 0
    for i in range(n):
        for j in range(m):
            best = find_best_combination(i, j)
            if best > best_combination:
                best_combination = best
                best_row, best_col = i, j
    if best_combination > n * m:
        return '-1'
    best_size = find_size(best_row, best_col)
    result = []
    for row in range(best_row - best_size // 2, best_row + best_size // 2 + 1):
        for col in range(best_col - best_size // 2, best_col + best_size // 2 + 1):
            result.append(f'{row + 1} {col + 1} {best_size}')
    return '\n'.join(result)

