    g = []
    b = []
    while n > 0:
        if n % 3 == 1:
            r.append(n)
        elif n % 3 == 2:
            g.append(n)
        else:
            b.append(n)
        n //= 3
    r.sort(reverse=True)
    g.sort(reverse=True)
    b.sort(reverse=True)
    r_res = []
    g_res = []
    b_res = []
    if len(r) % 3 == 0:
        r_res = r[:len(r) // 3]
    elif len(r) % 3 == 1:
        r_res = r[:len(r) // 3]
        r_res.append(r[-1])
    elif len(r) % 3 == 2:
        r_res = r[:len(r) // 3]
        r_res.append(r[-2])
        r_res.append(r[-1])
    if len(g) % 3 == 0:
        g_res = g[:len(g) // 3]
